　■侵入を強力に防ぐマスク(ふつうサイズ)です。<br>
■鉄芯ノーズフィッター、サイドブロッカー、アンダーブロッカーによって顔のかたちにぴったりフィットして、上下左右(鼻元・ほお・あご)にできるすき間をブロック。<br>
■口元の空間をキープして息苦しさを解消し、口の動きに柔軟に対応します。<br>
■長時間かけても耳が痛くなりにくい、ソフトタイプ耳ひもを使用しています。<br>
